CONDITION:   Details and samples of the facing materials shall be submitted to and approved in writing by the Local Planning Authority prior to any superstructure work commencing onsite. The samples and details shall include:

a)	brickwork (including brick panels with mortar courses) and render;
b)	timber, zinc and resoplan cladding;
c)	roofing materials;
d)	window treatment (including sections and reveals);
e)	balcony and balustrading treatment (including sections);
f)	doors/vents to refuse/recycling enclosures and cycle stores;
g)	entrances to all buildings shown in context and at scale 1:50; 
h)	any other relevant external cladding / facing material.

The development shall be carried out strictly in accordance with the details so approved, shall be maintained as such thereafter and no change therefrom shall take place without the prior written consent of the Local Planning Authority.

REASON:  To ensure that the resulting building is of a high standard of design, appearance and sustainable construction and to comply with policies D1 and D4 of the Islington UDP 2002 and policy 4B.8 of the London Plan 2008.
